    def generate_id(self):
        while True:
            new_id = ''.join(random.choices(string.ascii_letters + string.digits, k=5))
            generated_ids = set()
            for emp in self.cafe.userList:
                generated_ids.add(emp.user_id)
            if new_id not in generated_ids:
                return new_id
    
    def show_Error_data_message(self,message=""):
        msg =QMessageBox()
        msg.setIcon(QMessageBox.Warning)
